import Vue from "vue";
import firebase from "firebase";
import App from "./App.vue";
import router from "./router";

Vue.config.productionTip = false;

let app = "";

// Initialize Firebase
let config = {
    apiKey: "AIzaSyC-ZoFRdGvp7BReEMiWp_TptUa4jJifGqQ",
    authDomain: "storybox-2d2a2.firebaseapp.com",
    databaseURL: "https://storybox-2d2a2.firebaseio.com",
    projectId: "storybox-2d2a2",
    storageBucket: "storybox-2d2a2.appspot.com",
    messagingSenderId: "601238398574",
    appId: "1:601238398574:web:c5ff440aa4cdef8438687f"
};

firebase.initializeApp(config);

firebase.auth().onAuthStateChanged(() => {
    if (!app) {
        new Vue({
            router: router,
            render: h => h(App)
        }).$mount("#app");
    }
});
